import styled from 'styled-components'

const Input = styled.input`
    order: 1px solid #fff;
    background: transparent;
    border: 1px solid #fff;
    padding: 20px 180px;
    border-radius: 50px;
    width: 200px;
    color: #fff;
    font-size: 16px;
    margin-bottom;
    outline: none;

    &::placeholder{
        color: #fff;
        font-size: 16px;
        padding: 0 50px;
    }
`

export default Input
